import React from "react"
import Block from "./Block"


function BuildRow(board_row,method) {
    const row = []
    for (let column = 0; column < 8; column++) {
        row.push(<Block piece = {board_row[column]} handlePiece = {method}/>)
    }
    return row
}


function BlocksRow(props) {
    
    return (

        <tr>
            {BuildRow(props.board_row,props.handlePiece)}
        </tr>
    )
}

export default BlocksRow
